import * as React from "react";
import { Text, View } from "react-native";
import { Layout } from "react-native-rapi-ui";
import { Button } from "react-native-rapi-ui";
import { Ionicons } from "@expo/vector-icons";
import AddGroupBuy from "./AddGroupBuy";
import { createStackNavigator } from "@react-navigation/stack";

const Stack = createStackNavigator();
function GroupBuyScreen({ navigation }) {
  return (
    <Layout>
      {/* need to change to image */}
      <Button
        text="Order Group buy "
        onPress={() => navigation.navigate("AddGroupBuy")}
        size="lg"
      />
      <Button text="View Last orders " size="lg" />
    </Layout>
  );
}

export default function GroupBuyStack() {
  return (
    <Stack.Navigator>
      <Stack.Screen name="Available Stalls" component={GroupBuyScreen} />
      <Stack.Screen
        title="Dabao for me!"
        name="AddGroupBuy"
        component={AddGroupBuy}
      />
      <Stack.Screen name="ViewOrders" component={ViewOrdersScreen} />
    </Stack.Navigator>
  );
}
